import Link from 'next/link'

const Toolbar = () => {
	return (
		<div>
			<ul
				style={{
					display: 'flex',
					flexDirection: 'row',
				}}
			>
				<li>
					<Link href="/">Home</Link>
				</li>
				<li>
					<Link href="about">About</Link>
				</li>
			</ul>
		</div>
	)
}

export default Toolbar
